	this.createNode = function(ip, parent_ip) {
		var node = {
			type: ip,
			id: ip,
			parent: parent_ip,
			name: ip
		}
		return node;
	};
	
	this.createLink = function(flow) {
		var link = {
			source: flow.sourceIP,
			target: flow.targetIP,
			value: flow.totalBytesTransferred
		}
		return link;
	};

	this.initDummy = function() {
		var self = this;
		var ips = [];
		this.getDummyHosts().forEach(function(host) {
			var ip_split = host.ip.split(".");
			var short_ip = ip_split[0] + "." + ip_split[1] + "." + ip_split[2] + ".*";
			var parent;
			if (!_.contains(ips, short_ip)) {
				parent = self.createNode(short_ip);
				self.nodes.push(parent);
				ips.push(short_ip);
			}
			var node = self.createNode(host.ip, short_ip);
			self.nodes.push(node);
			ips.push(node.id);
		});
		this.getDummyHosts().forEach(function(host) {
			host.incoming.forEach(function(flow) {
				var link = self.createLink(flow);
				if (_.contains(ips, link.source) && _.contains(ips, link.target)) {
					self.links.push(link);
				}
			})
		});
		this.getDummyHosts().forEach(function(host) {
			host.outgoing.forEach(function(flow) {
				var link = self.createLink(flow);
				if (_.contains(ips, link.source) && _.contains(ips, link.target)) {
					self.links.push(link);
				}
			})
		});
		self.links.sort(function(a,b){a.value-b.value});
	};

	this.getNetworkHosts = function() {
		// TODO
	};
	
	this.getNodes = function() {
		return this.nodes;
	}
	
	this.getLinks = function(i) {
		if (i !== "undefined") {
			return this.links.slice(0, i);
		} else {
			return this.links;
		}
	}
	
